      SELECT ALL 62 * - 11 AS col1 FROM tab2 (FORMAT parquet) WHERE 69 BETWEEN ( ( col1 ) * + ( col1 + 74 ) ) AND ( col1 * + CAST ( + 28 / - col2 AS INTEGER ) );
  - name: tab2

outputs:
  - name: q11672.out
    data: |
